    });

    //console.log(data);
    const logOut = () => {
        user.setUser({})
        user.setIsAuth(false)
        localStorage.removeItem('token')
        history.push(PHOTOGALLERY_ROUTE)
    }
    
    return (
        <Navbar bg="dark" variant="dark">
            <Container>

                <NavLink style={{color:'white'}} className='text-decoration-none' to={ PHOTOGALLERY_ROUTE}>ФотографииНаПамять</NavLink>   

                {user._isAuth ?
                    <Nav  style={{color: 'white'}}>
                        <Button
                            variant={"outline-light"}
                            onClick={() => history.push(ADMIN_ROUTE)}
                        >
                           Пользователь {user._user.email}
                        </Button>
                        <Button
                            variant={"outline-light"}
                            onClick={() => logOut()}
                            
                        >
                            Выйти
                        </Button>
                    </Nav>
                    :
                    <Nav style={{color: 'white'}}>
                        <Button variant={"outline-light"} size="lg" onClick={() => history.push(LOGIN_ROUTE)}>Авторизация</Button>
                        <Button variant={"outline-light"} size="lg" onClick={() => history.push(REGISTRATION_ROUTE)}>Регистрация</Button>
                    </Nav>
                }
               
  
            </Container>
        </Navbar>

    );
});

export default NavBar;
